INSERT INTO `seasonal_review` (`no`, `youth`, `counselor`, `date`, `is_counseling`, `trend`, `trend_description`) VALUES (1037, 919, 88, '2021-01-12', 0, '139', '案父表示曾生休學一年，並於109年9月安排曾生與案父友人一同貼磁磚(月薪3萬)，曾生適應良好，然案父仍期待曾生可持續升學，取得高職學歷。案父有意了解未來升學相關程序，社工回應確認程序後，將於下次追蹤再行說明。(查需重新參與當年度會考-由嘉中或嘉女主辦，取得成績，並與國中教務處申請在校成績，再向免試入學主辦之學校登記高中職)。');
